import React from 'react';
import './css/App.scss';
import {spacer1, spacer2, spacer3, spacer4} from './components/constants';
import { BrowserRouter } from 'react-router-dom'
import { HashRouter as Router, Route, Switch } from 'react-router-dom';
import Main from './components/Main';

import {setConfiguration} from 'react-grid-system';

import Navbar from './components/navbar';
import ContactFooter from './components/footer';
import Home from './pages/Home';
import About from './pages/About';

setConfiguration({
  gutterWidth: 80,
  containerWidths: [2000, 2000, 2000, 2000]
});

function App() {
  return (
    <div className="App" style={{margin: spacer3}}>
      <Router componnent={Navbar}>
        <Switch>
          <Route exact path="/" componnent={Home} />
          <Route exact path="/About" componnent = {About} />
        </Switch>
      </Router>
    <ContactFooter />
    </div>
  );
}

export default App;
